    function colorRegions(d3Path,rows, coloringMethod){
            d3Path.transition()
                .duration(500)
                .style("fill", function(d){
                return coloringMethod.call(this, d.id, rows);
            });
    }

    function drawEffect(d3Path) {
        return d3Path.style("opacity",0)
            .transition()
            .duration(300)
            .delay(function(d){ return 20*parseInt(d.id); })
            .style("opacity", 1);
    }

    function drawRegions(d3Path) {
        return d3Path.data(svallPath)
                .enter()
                .append("path")
                .attr("class","state")
                .attr("d",function(d){ return d.d;});
    }

    function setEventHandler(d3Path,rows, eventHandler) {
        var handlers = eventHandler.call(this, rows);

        for(var h in handlers ) {
            if(handlers.hasOwnProperty(h)){
                d3Path.on(h, handlers[h]);
            }
        }

    }

    function convertRows2Data(rows) {
        var data = {};

        rows.forEach(function(row) {
            data[row.nyko] = {
                average: row.average,
                sum: row.sum,
                minimum: row.minimum,
                maximum: row.maximum
            };
        });
        return data;
    }

